import React from "react";
import { useParams } from "react-router-dom";

import "./detail.css";

function Detail() {
    const { time } = useParams();
    console.log(time);
    return (
        <div>
            <h3>Message Detail</h3>
            <div className="myDetail">
                <div>time: {(new Date(Number(time))).toString()}</div>
            </div>
        </div>
    )
}

export default Detail;
